    <Container>
      <Logo src="images/logo.svg"/>

      
      <ItemText>
        <p>Home</p>
        <p>About us</p>
      </ItemText>
    </Container>

  
  )
}

export default Header

const Container=styled.div`
height:70px;
background-color:#090b13; 

